import React, { Component } from 'react'; 
import PlayfulPalette2 from './assets/playfulpalette2.jpg';
import NYTCrossword from './assets/nytcrossword.jpg';
import SyriaCover from './assets/syriacover.jpg';
import Campaignion from './assets/campaignion-2.png'; 

class CodePage extends Component {

    render() {
        return (
          <div>
            <div class="container">
              <div class="row">
                <div class="col">
                    <img src={Campaignion} alt="Campaignion thumbnail" class="cropped"></img>
                </div>
                <div class="col">
                    <img src={PlayfulPalette2} alt="Playful Palette thumbnail" class="cropped"></img>
                </div>
              </div>
             </div>
            <div class="container">
              <div class="row">
                <div class="col">
                    <img src={NYTCrossword} alt="NYT Crossword thumbnail" class="cropped"></img>
                </div>
                <div class="col">
                    <div class="video"><iframe src="https://player.vimeo.com/video/230313693?title=0&byline=0&portrait=0" class="video-frame" frameborder="0" allow="autoplay; fullscreen; picture-in-picture" allowfullscreen></iframe></div><script src="https://player.vimeo.com/api/player.js"></script>                </div>
              </div>
             </div>
          </div>
        ) 
    }
}
export default CodePage;
